message:
DEUS ENTREGOU 

Além do mais, visto que desprezaram o conhecimento de Deus, ele os entregou a uma disposição mental reprovável, para praticarem o que não deviam. Tornaram-se cheios de toda sorte de injustiça, maldade, ganância e depravação. Estão cheios de inveja, homicídio, rivalidades, engano e malícia. São bisbilhoteiros, caluniadores, inimigos de Deus, insolentes, arrogantes e presunçosos; inventam maneiras de praticar o mal; desobedecem a seus pais; são insensatos, desleais, sem amor pela família, implacáveis. Embora conheçam o justo decreto de Deus, de que as pessoas que praticam tais coisas merecem a morte, não somente continuam a praticá-las, mas também aprovam aqueles que as praticam. 
Romanos 1:28 - 32 NVI 

Deus estabeleceu os céus, a terra e toda a criação para a Sua glória. Fomos criados para o Seu louvor. E devemos dar honra a Ele. Nosso propósito de vida é adorar a Deus.

Nestes versículos, de 28  a 32, esta claramente identificado que, se não cumprirmos o propósito pelo qual fomos criados, ou seja, se temos conhecimento de Deus, e O desprezar, o próprio Deus nos deixa praticar coisas inconvenientes contra a nossa própria vida.

No texto, entendemos que certas práticas errôneas, é possível sinal que o próprio Deus o ENTREGOU a praticar:

- Injustiça e maldade;
- Ganância e depravação;
- Inveja e homicídio;
- Rivalidades, engano e malícia;
- Bisbilhoteiro e caluniadores;
- inimigos de Deus e insolentes;
- Arrogantes e preguiçosos;
- Praticam o mal;
- Desobedientes aos pais;
- Insensatos e desleais;
- Sem amor pela família;
- Implacáveis.

Essas são algumas das coisas inconvenientes praticadas por aqueles que desprezam a Deus.  Desenvolver essas coisas, são dignos de morte e não apenas quem as praticam, mas, também àqueles que aprovam pessoas praticarem isso também são dignos de morte.

Que possamos ser sábios neste ensino de Paulo. Sejamos prudentes e não agir como ímpios. Praticando o mal. Pois, isso é de fato que está sem Deus.

Tenham excelente Domingo, Dia do Senhor!

